import { useState, useEffect } from "react";
import axios from "axios";
import Layout from "../layout";
import Filter from "../components/filter";

function Collection(props) {
  const [products, setProducts] = useState([]);

  useEffect((_) => {
    axios
      .post("/products", { category: props.name })
      .then((res) => setProducts(res.data))
      .catch((err) => console.log(err));
  }, []);

  return (
    <Layout>
      <div className="w-11/12 md:w-4/5 pt-20 m-auto">
        <h2 className="text-xl">
          {props.name} Shoes ({products.length > 0 ? products.length : "0"})
        </h2>
        <div className="mt-4 *:inline-block *:align-top">
          <div className="w-1/4 md:w-2/12">
            <Filter />
          </div>
          <div className="w-8/12 md:w-3/4 ml-9">
            <div className="flex flex-wrap justify-between w-2/4">
              {products.length > 0
                ? products.map((product) => (
                    <a key={product._id} href={`/product/${product.slug}`}>
                      <div className="flex flex-col text-sm md:text-base mt-4">
                        <img src="" alt={product.name} />
                        <p className="font-medium mt-2 text-gray-900">
                          {product.name}
                        </p>
                        <p className="text-gray-500">
                          {product.category} Shoes
                        </p>
                        <p className="font-medium mt-2 text-gray-900">
                          ${product.price}.00
                        </p>
                      </div>
                    </a>
                  ))
                : "No products found"}
            </div>
          </div>
        </div>
      </div>
    </Layout>
  );
}

export default Collection;
